text:
היי!
אני עמית, דאטה אנליסט בחברת פיוניר ובכללי בתחום הדאטה כבר כמה שנים. את האתרון הזה החלטתי לפתוח כשהבנתי שאני אוהב לשתף דברים מגניבים שיצא לי לפתור בעבודה, אבל הבנתי שאין לי יותר מדי עם מי בצורה קלה. ולכן במקום לנסות למצוא אנשים ספציפיים שאחפור להם, החלטתי להנגיש את זה לכולם. חוץ מזה, התחשק לי לפרסם קצת תוכן על דאטה בעברית, אז עוד סיבה לפתיחה שלו.
זהו, מוזמנים להגיד שלום/הערות/בקשות באחד מהקישורים מטה =&gt;

יצירת הטבלה
